import React from 'react'
import { ButtonAddOrEditStyle } from '../styledComponents/Buttons';

const Button = (props) => {
    //className={classes.title}
    return (
        <ButtonAddOrEditStyle onClick={props.HandlePress}>{props.butttoTitle}
           
        </ButtonAddOrEditStyle>
    )
}

export default Button
